import React from 'react';
import '../styles/CloudShooter-h.css';
import GameCanvas from './GameCanvas';

const CloudShooter = () => {
  return (
    <div className="cloud-shooter-wrapper">
      <div className="cloud-shooter-container-isolated">
        <GameCanvas />
      </div>
    </div>
  );
};

export default CloudShooter;
